import React from 'react'
import CoinTable from './components/data-table'

import data from './data/data.json'

import './app.css'

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      data: data,
    }
    this.sortBy = this.sortBy.bind(this)
  }



  render() {
    return (

        <CoinTable
          data={this.state.data}
          sortBy={this.sortBy}
        />

    )
  }
}

export default App
